import React from 'react';
import StudentFilters from "./StudentFilters";
import StudentActions from "./StudentActions";

const StudentTableSectionContainer = props => {
  return (
    <Grid container>
      <StudentFilters />
      <StudentActions />
    </Grid>
  );
}

export default StudentTableSectionContainer;
